// src/features/crypto/components/CryptoTable.js
import React from 'react';
import { useSelector } from 'react-redux';
import CryptoRow from './CryptoRow';

const CryptoTable = () => {
  const cryptoData = useSelector((state) => state.crypto.data);

  return (
    <div className="overflow-x-auto">
      <table className="min-w-full table-auto border border-collapse border-gray-300">
        <thead className="bg-gray-200">
          <tr>
            <th className="p-2 text-left">Name</th>
            <th className="p-2 text-left">Symbol</th>
            <th className="p-2 text-left">Price (USD)</th>
          </tr>
        </thead>
        <tbody>
          {cryptoData.map((coin) => (
            <CryptoRow key={coin.symbol} coin={coin} />
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default CryptoTable;
